import React from "react";
import { Parallax } from "react-scroll-parallax";

export default function TheOriginalSix() {
  return (
    <div>
      <Parallax className="custom-class" y={[-20, 20]} tagOuter="figure">
        <Image src="/image.jpg" />
      </Parallax>
    </div>
  );
}
